import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Home (props1) {
   
    return (
        <SafeAreaView style = {css.fundo}>
            <View style = {css.container2}>
                <TouchableOpacity title = "Ir para Login" onPress={()=>props1.navigation.navigate('Login')} style = {css.button1}>Teste 1</TouchableOpacity>
                <TouchableOpacity title = "Ir para Page" onPress={()=>props1.navigation.navigate('Page')} style = {css.button2}>Teste 2</TouchableOpacity>
            </View>
        </SafeAreaView>
    );
    
}
